import axios from 'axios';
import { useState, useEffect } from 'react';

const CreateStrategyMACD = ({ company, num1, num2, stopProfit, stopLoss, userID }) => {

  const [strategy, setStrategy] = useState([])

  useEffect(() => {
    axios.post('http://127.0.0.1:8000/api/create/macd', {         //某種function，傳入各種數值進入策略的資料庫中
      "Creator_id": userID,
      "Company_id": company,
      "Fast_line": num1,
      "Slow_line": num2,
      "Profit": stopProfit, 
      "Loss": stopLoss
    })
    .then((res) => { 
      setStrategy(res.data)
    })
    .catch((error) => { console.log(error) })
  },[])
  return <>
  </>
}

export default CreateStrategyMACD
